policy_refunds: "I want you to be happy - and will always work to ensure you are satisfied with your purchase. As such, you can return a work in original condition (in original packaging) with no questions asked within 10 days of receipt for merchandise credit/exchange less actual shipping cost. Merchandise credit can be used anytime and will never expire. Returns: Buyer notifies and ships within ten days of receipt, and provides shipping (except when damage during shipment or listing error occurs), including notice of shipping return. When shipping a return, shipping insurance is required - and tracking and delivery confirmation provided. Upon receipt of the return, merchandise credit given, less cost of shipping. If there is a listing error (hasn‚Äôt happened, but just in case), contact immediately upon receipt of shipment for a return and full refund, including return shipping. Shipping issues: My paintings are well-packaged using professional shipping materials, so it is extremely unlikely anything would occur. However, if the artwork arrives damaged, please contact me as soon as you receive the shipment. I will then arrange to have the package returned and arrange to repair, replace, or fully refund.",
